) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

/*Data for the table `information` */

insert  into `information`(`id`,`inforContent`,`inforUrl`,`title`,`picUrl`,`toUserName`) values (0000000001,'从2013年12月30日，中共中央政治局决定成立中央全面深化改革领导小组，到今年的9月24日，深改小组成立已满整整1000天。','http://china.huanqiu.com/article/2016-09/9489482.html?from=bdwz','深改千日 如何做到打铁还需自身硬',NULL,NULL),(0000000002,'中新网北京9月27日电（记者 李金磊）收费公路改革有了明确的时间表。26日发布的《物流业降本增效专项行动方案（2016—2018年）》提出，抓紧修订《收费公路管理条例》，调整完善收费公路政策，科学合理确定车辆通行费标准，并要求在2017年底前完成。','http://www.cankaoxiaoxi.com/roll10/bd/20160927/1318872.shtml','收费公路改革明确时间表 要求2017年底前完成',NULL,NULL);

