/*Table structure for table `weixin_useraccount` */

DROP TABLE IF EXISTS `weixin_useraccount`;

CREATE TABLE `weixin_useraccount` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `subscribe` int(11) unsigned zerofill DEFAULT NULL,
  `openid` varchar(200) DEFAULT NULL,
  `nickname` varchar(100) DEFAULT NULL,
  `sex` int(11) unsigned zerofill DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `country` varchar(50) DEFAULT NULL,
  `province` varchar(50) DEFAULT NULL,
  `language` varchar(50) DEFAULT NULL,
  `headimgurl` varchar(200) DEFAULT NULL,
  `subscribe_time` int(11) unsigned zerofill DEFAULT NULL,
  `unionid` varchar(200) DEFAULT NULL,
  `remark` varchar(200) DEFAULT NULL,
  `groupid` int(11) unsigned zerofill DEFAULT NULL,
  `tagid_list` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=167 DEFAULT CHARSET=utf8mb4;

